import React, { useState } from "react";

function App() {
  const [demandId, setDemandId] = useState("");
  const [duration, setDuration] = useState(24);
  const [durationUnit, setDurationUnit] = useState('hours');
  const [logs, setLogs] = useState([]);
  const [count, setCount] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [wfmsLogs, setWfmsLogs] = useState([]);
  const [pricingLogs, setPricingLogs] = useState([]);
  const [consignerLogs, setConsignerLogs] = useState([]);
  const [tesseractLogs, setTesseractLogs] = useState([]);
  const [summary, setSummary] = useState(null);
  const [summaryLoading, setSummaryLoading] = useState(false);
  const [showSummary, setShowSummary] = useState(false);

  const fetchLogs = async () => {
    setLoading(true);
    setError(null);
    setWfmsLogs([]);
    setPricingLogs([]);
    setConsignerLogs([]);
    setTesseractLogs([]);
    setLogs([]);
    setCount(null);
    try {
      const res = await fetch(`/api/logs?demandId=${demandId}&duration=${duration}&unit=${durationUnit}`);
      const data = await res.json();
      setWfmsLogs(data.wfmsLogs || []);
      setPricingLogs(data.pricingLogs || []);
      setConsignerLogs(data.consignerLogs || []);
      setTesseractLogs(data.tesseractLogs || []);
      setCount(data.count);
    } catch (err) {
      setError(err.message);
    }
    setLoading(false);
  };

  const fetchSummary = async () => {
    setSummaryLoading(true);
    setError(null);
    setSummary(null);
    try {
      const res = await fetch(`/api/logs/summary?demandId=${demandId}&duration=${duration}&unit=${durationUnit}`);
      const data = await res.json();
      setSummary(data);
      setShowSummary(true);
    } catch (err) {
      setError(err.message);
    }
    setSummaryLoading(false);
  };

  const resetLogs = () => {
    setWfmsLogs([]);
    setPricingLogs([]);
    setConsignerLogs([]);
    setTesseractLogs([]);
    setLogs([]);
    setCount(null);
    setSummary(null);
    setShowSummary(false);
    setError(null);
  };

  return (
    <div style={{ padding: 32, fontFamily: 'sans-serif' }}>
      <h2>WFMS Log Search</h2>
      <input
        placeholder="Demand ID"
        value={demandId}
        onChange={e => setDemandId(e.target.value)}
        style={{ marginRight: 8 }}
      />
      <input
        type="number"
        placeholder="Duration"
        value={duration}
        onChange={e => setDuration(e.target.value)}
        style={{ marginRight: 8, width: 120 }}
        min={1}
      />
      <select value={durationUnit} onChange={e => setDurationUnit(e.target.value)} style={{ marginRight: 8 }}>
        <option value="hours">Hours</option>
        <option value="minutes">Minutes</option>
      </select>
      <button onClick={fetchLogs} disabled={loading || !demandId}>
        {loading ? "Loading..." : "Fetch Logs"}
      </button>
      <button onClick={fetchSummary} disabled={summaryLoading || !demandId} style={{ marginLeft: 8 }}>
        {summaryLoading ? "Loading..." : "View Pod-wise Summary"}
      </button>
      <button onClick={resetLogs} style={{ marginLeft: 8 }}>
        Reset Logs
      </button>
      <div style={{ marginTop: 24 }}>
        {error && <div style={{ color: 'red' }}>Error: {error}</div>}
        {count !== null && <div>Log Count: {count}</div>}
        <h3>WFMS Logs</h3>
        <pre style={{ maxHeight: 200, overflow: "auto", background: "#f5f5f5", padding: 12 }}>
          {wfmsLogs.map((log, i) => (
            <div key={i}>
              <b>@timestamp:</b> {log['@timestamp'] || ''}<br/>
              <b>log:</b> {log['log'] || ''}
            </div>
          ))}
        </pre>
        <h3>Pricing Logs</h3>
        <pre style={{ maxHeight: 200, overflow: "auto", background: "#f5f5f5", padding: 12 }}>
          {pricingLogs.map((log, i) => (
            <div key={i}>
              <b>@timestamp:</b> {log['@timestamp'] || ''}<br/>
              <b>log:</b> {log['log'] || ''}
            </div>
          ))}
        </pre>
        <h3>Consigner Aggregator Logs</h3>
        <pre style={{ maxHeight: 200, overflow: "auto", background: "#f5f5f5", padding: 12 }}>
          {consignerLogs.map((log, i) => (
            <div key={i}>
              <b>@timestamp:</b> {log['@timestamp'] || ''}<br/>
              <b>log:</b> {log['log'] || ''}
            </div>
          ))}
        </pre>
        <h3>Tesseract Logs</h3>
        <pre style={{ maxHeight: 200, overflow: "auto", background: "#f5f5f5", padding: 12 }}>
          {tesseractLogs.map((log, i) => (
            <div key={i}>
              <b>@timestamp:</b> {log['@timestamp'] || ''}<br/>
              <b>log:</b> {log['log'] || ''}
            </div>
          ))}
        </pre>
      </div>
      {showSummary && summary && (
        <div style={{ marginTop: 32, background: '#eef', padding: 16, borderRadius: 8 }}>
          <h3>Pod-wise Log Summary</h3>
          {Object.entries(summary).map(([service, pods]) => (
            <div key={service} style={{ marginBottom: 32 }}>
              <h4>{service.replace('Logs', '')}:</h4>
              {pods.length === 0 && <div>No logs found.</div>}
              {/* Custom WFMS format */}
              {service === 'wfmsLogs' ? (
                Array.isArray(pods) && pods.map((pod, i) => (
                  <div key={i} style={{ marginBottom: 24, padding: 8, background: '#fff', borderRadius: 4, border: '1px solid #ccd' }}>
                    <b>Pod:</b> {pod.pod}
                    {Array.isArray(pod.formattedLogs) && pod.formattedLogs.map((log, idx) => (
                      <div key={idx} style={{ marginLeft: 16, marginTop: 8 }}>
                        <div>{log.time.replace('T', ' ').slice(0, 19)}</div>
                        <div>{log.eventType}</div>
                        {Array.isArray(log.fields) && log.fields.length > 0 && (
                          <div style={{ marginLeft: 16 }}>
                            {log.fields.map((f, j) => <div key={j}>{f}</div>)}
                          </div>
                        )}
                      </div>
                    ))}
                    {/* Summary Table */}
                    <div style={{ marginTop: 12 }}>
                      <b>Summary Table:</b>
                      <table style={{ width: '100%', background: '#f9f9f9', borderCollapse: 'collapse', marginTop: 4 }}>
                        <thead>
                          <tr>
                            <th style={{ border: '1px solid #ccc', padding: 4 }}>Time (UTC)</th>
                            <th style={{ border: '1px solid #ccc', padding: 4 }}>Pod</th>
                            <th style={{ border: '1px solid #ccc', padding: 4 }}>Event/Service</th>
                            <th style={{ border: '1px solid #ccc', padding: 4 }}>Status/Details</th>
                          </tr>
                        </thead>
                        <tbody>
                          {Array.isArray(pod.summaryRows) && pod.summaryRows.map((row, ridx) => (
                            <tr key={ridx}>
                              <td style={{ border: '1px solid #ccc', padding: 4 }}>{row.time}</td>
                              <td style={{ border: '1px solid #ccc', padding: 4 }}>{row.pod}</td>
                              <td style={{ border: '1px solid #ccc', padding: 4 }}>{row.event}</td>
                              <td style={{ border: '1px solid #ccc', padding: 4 }}>{row.details}</td>
                            </tr>
                          ))}
                        </tbody>
                      </table>
                    </div>
                  </div>
                ))
              ) : (
                // Default format for pricing/consigner
                pods.map((pod, i) => {
                  const demandCreated = pod.demandCreated;
                  const operatorQuotes = (pod.quotes || []).filter(q => q.includes('OperatorDemandQuotation') || q.includes('OpDemandQuotationProcessingRequest'));
                  const demandBiddingQuotes = (pod.quotes || []).filter(q => q.includes('DemandBiddingQuoteDTO'));
                  const statusTransitions = (pod.statusUpdates || []);
                  const broadcasts = (pod.demandCreated && pod.demandCreated.includes('ShipperBroadcast')) ? [pod.demandCreated] : [];
                  const quoteAmounts = pod.quotes
                    ? pod.quotes.map(q => {
                        const match = q.match(/quoteAmount=([0-9.]+)/);
                        return match ? match[1] : null;
                      }).filter(Boolean)
                    : [];
                  const statusMatch = statusTransitions.map(s => {
                    const match = s.match(/status: ([A-Z_]+)/);
                    return match ? match[1] : null;
                  }).filter(Boolean);
                  const getTime = (logStr) => {
                    const match = logStr && logStr.match(/(\d{4}-\d{2}-\d{2} \d{2}:\d{2}:\d{2})/);
                    return match ? match[1] : '';
                  };
                  const summaryRows = [];
                  if (demandCreated) summaryRows.push({
                    time: getTime(demandCreated),
                    event: 'Demand Created/Processed',
                    details: statusMatch[0] ? `Status: ${statusMatch[0]}` : ''
                  });
                  if (quoteAmounts.length > 0) summaryRows.push({
                    time: getTime(pod.quotes[0]),
                    event: 'Rate Card Quotes Generated',
                    details: quoteAmounts.join(', ')
                  });
                  if (demandBiddingQuotes.length > 0) summaryRows.push({
                    time: getTime(demandBiddingQuotes[0]),
                    event: 'Demand Bidding Quotes',
                    details: demandBiddingQuotes.map(q => {
                      const match = q.match(/quoteAmount=([0-9.]+)/);
                      return match ? match[1] : null;
                    }).filter(Boolean).join(', ')
                  });
                  if (broadcasts.length > 0) summaryRows.push({
                    time: getTime(broadcasts[0]),
                    event: 'Shipper Broadcast Scheduled',
                    details: `demandId=${demandId}`
                  });
                  if (statusTransitions.length > 0) summaryRows.push({
                    time: getTime(statusTransitions[0]),
                    event: 'Demand Status Updated',
                    details: statusMatch.join(', ')
                  });
                  return (
                    <div key={i} style={{ marginBottom: 24, padding: 8, background: '#fff', borderRadius: 4, border: '1px solid #ccd' }}>
                      <b>Pod:</b> {pod.pod} <b>Count:</b> {pod.count}<br/>
                      {/* 1. Demand Creation & Processing */}
                      <div style={{ marginTop: 8 }}>
                        <b>1. Demand Creation & Processing</b>
                        <div><b>Demand Created:</b> <pre style={{ display: 'inline', background: 'none', padding: 0 }}>{demandCreated || 'N/A'}</pre></div>
                        <div><b>Union Quotes, Price Range, and Rate Card Generation:</b></div>
                        {(pod.quotes || []).filter(q => q.includes('RateCard') || q.includes('UnionQuotes') || q.includes('PriceRange')).map((q, idx) => (
                          <pre key={idx} style={{ display: 'inline', background: 'none', padding: 0 }}>{q}</pre>
                        ))}
                      </div>
                      {/* 2. Quotes Generated */}
                      <div style={{ marginTop: 8 }}>
                        <b>2. Quotes Generated</b>
                        <div><b>Operator Quotes:</b></div>
                        {operatorQuotes.length > 0 ? operatorQuotes.map((q, idx) => (
                          <pre key={idx} style={{ display: 'inline', background: 'none', padding: 0 }}>{q}</pre>
                        )) : 'N/A'}
                        <div><b>Demand Bidding Quotes:</b></div>
                        {demandBiddingQuotes.length > 0 ? demandBiddingQuotes.map((q, idx) => (
                          <pre key={idx} style={{ display: 'inline', background: 'none', padding: 0 }}>{q}</pre>
                        )) : 'N/A'}
                      </div>
                      {/* 3. Status Updates */}
                      <div style={{ marginTop: 8 }}>
                        <b>3. Status Updates</b>
                        <div><b>Demand Status Transitions:</b></div>
                        {statusTransitions.length > 0 ? statusTransitions.map((s, idx) => (
                          <pre key={idx} style={{ display: 'inline', background: 'none', padding: 0 }}>{s}</pre>
                        )) : 'N/A'}
                      </div>
                      {/* 4. Broadcasts & Notifications */}
                      <div style={{ marginTop: 8 }}>
                        <b>4. Broadcasts & Notifications</b>
                        <div><b>Shipper Broadcast:</b></div>
                        {broadcasts.length > 0 ? broadcasts.map((b, idx) => (
                          <pre key={idx} style={{ display: 'inline', background: 'none', padding: 0 }}>{b}</pre>
                        )) : 'N/A'}
                      </div>
                      {/* 5. Summary Table */}
                      <div style={{ marginTop: 8 }}>
                        <b>5. Summary Table</b>
                        <table style={{ width: '100%', background: '#f9f9f9', borderCollapse: 'collapse', marginTop: 4 }}>
                          <thead>
                            <tr>
                              <th style={{ border: '1px solid #ccc', padding: 4 }}>Time (UTC)</th>
                              <th style={{ border: '1px solid #ccc', padding: 4 }}>Event/Service</th>
                              <th style={{ border: '1px solid #ccc', padding: 4 }}>Details/Quote Amounts</th>
                            </tr>
                          </thead>
                          <tbody>
                            {summaryRows.map((row, ridx) => (
                              <tr key={ridx}>
                                <td style={{ border: '1px solid #ccc', padding: 4 }}>{row.time}</td>
                                <td style={{ border: '1px solid #ccc', padding: 4 }}>{row.event}</td>
                                <td style={{ border: '1px solid #ccc', padding: 4 }}>{row.details}</td>
                              </tr>
                            ))}
                          </tbody>
                        </table>
                      </div>
                    </div>
                  );
                })
              )}
            </div>
          ))}
          <button onClick={() => setShowSummary(false)} style={{ marginTop: 8 }}>Hide Summary</button>
        </div>
      )}
    </div>
  );
}

export default App;
